import React from 'react';
import './App.css';
import Login from './components/Login'
import HomeContainer from './components/HomeContainer'
import {BrowserRouter} from 'react-router-dom'

function App() {
  ROOTPATH = "http://localhost:3000"
  return (
    <div className="App">
      <BrowserRouter>
        <Link to={`${ROOTPATH}/`} component={Login}></Link>
        <Link to={`${ROOTPATH}/home`} component={HomeContainer}></Link>
      </BrowserRouter>
      <Login/>
    </div>
  );
}

export default App;
